import { Link } from "react-router-dom";

const Detailspecific = () => { 
    return ( 
        <div id="project-details " className="my-40 text-left">
            <Link to="/work" className="text-2xl font-bold text-white"><i className="bi bi-arrow-left mr-2"></i>BACK</Link>
            <h1 className="text-6xl font-semibold mb-12 text-white">ComputerPhile</h1>
            <p className="text-3xl mb-12 text-white" > While ChargedUp was one of the hottest London startups of 2019, their mobile apps were in dire need of attention.</p>
            <p className="text-3xl mb-12 text-white">Alarm bells rang when their support team started receiving requests from customers who had trouble performing basic tasks within the apps.</p>
            
            <div className="project-image p-12">
                <img className="m-auto rounded-2xl" src="/full-preview.jpg" alt=""/>
            </div>

            <Link to=""><button type="button" className="btn btn-lg relative">Visit Website</button></Link>  
        </div>
     );
}
 
export default Detailspecific;
